import "./index.css";

function Header() {
  return (
    <div className="row justify-content-center">
        <div className="col-sm-12 col-md-12 col-lg-12" id="header">
            <div className="row justify-content-center">
                <p>SOME RANDOM QUTOE" - PERSON</p>
            </div>
        </div>
    </div>
  );
}

export default Header;
